import style from './App.css';
import IntroMe from './IntroMe';
import AboutMe from './About_me';
import ContactMe from './ContactMe';
import Footer from './Footer';
import SecComponent from './SecComponent';
import { useState } from 'react'
function App() {
  const modechangedark = () => {
    var mode = document.getElementsByClassName("App");
    mode.style.color = "red";
  }
  const [modechange, setmodechange] = useState(style)
  return (
    <div className="App" style={modechang}>
      <header className="App-header">
        <div className='logo'>
          {/* <img className='p-logo' src=''/> to be here*/}
          <button className="btn-mode" onClick={ () => setmodechange({modechangedark}) }>Dark Mode</button>
        </div>
        <div className='menu_container'>
          <div className='about_me' id='about_me'>About me</div>
          <div className='my_projects' id='my_projects'>Projects</div>
          <div className='contact_me' id='contact_me'>Contact me</div>
        </div>
      </header>
      <IntroMe />
      <SecComponent topic= { "About me" }/>
      <AboutMe />
      <SecComponent topic= { "Projects" }/>
      <AboutMe />
      <SecComponent topic= { "Contact me" } />
      <ContactMe />
      <Footer />
    </div>
  );
}

export default App;
